function createexam()  {  
      if(isset($_POST["save"])){
          include('config/dbconnection.php');
        
          $user_id = trim($_POST['userid']);
          $exam_name = trim($_POST['examname']);     
          $exlogo = trim($_POST['exlogo']);
         // $exlogo = substr(trim($_POST['exlogo']), 23);
          $state = trim($_POST['state']);
         
          if(empty($state)){
            $sql = "INSERT INTO `exam`(`name`, `logo`, `userid`) VALUES (:exam_name,:exam_logo,:userid)";
              $r = $db->prepare($sql);
               $insertvisitor = $r->execute(array( ':exam_name'=>$exam_name, ':exam_logo'=>$exlogo, ':userid'=> $user_id));             
            if($insertvisitor){ 
              echo "<div style='text-align:center;' class='list-group-item list-group-item-success'>Added Successfull</div>";
              //header("Location: paper.php");
            }else{ 
            echo "<div class='list-group-item list-group-item-danger'>Not Created</div>";
            }           
          }else{           
            $insert = $db->query("UPDATE `exam` SET `name`= '$exam_name', `logo`= '$exlogo' WHERE id = $state"); 
            $insert->execute();
            if($insert){ 
            echo "<div style='text-align:center;' class='list-group-item list-group-item-success'>Update Successfull</div>";
            }else{ 
            echo "<div class='list-group-item list-group-item-danger'>Unsuccessfull</div>";
            }
      }
        }
      
}

