function createpaper()  {      
      if(isset($_POST["save"])){
        include('config/dbconnection.php');
        $exid=$_POST['exid'];
        $pprname=$_POST['pprname'];
        $pprcode=$_POST['pprcode'];
        $duration=$_POST['examduration'];
        $examdate=$_POST['examdate'];
        $ttlset=$_POST['examset'];
        $ttlques=$_POST['ttlques'];
        $ttlmark = $_POST['ttlmark'];
        $extime = $_POST['examtime'];
        $password =$_POST['password'];
         $imgins = "data:image/jpeg;base64,";
        
        try {      
          $sql = "INSERT INTO `papermaster`(`examid`, `papername`, `papercode`, `duration`, `examdate`, `ttlset`, `ttlquestions`, `ttlmarks`) VALUES (:exid,:name,:pprcode,:duration,:exdate,:ttlset,:ttlques,:ttlmark)";
            $r = $db->prepare($sql);  
            $insertvisitor = $r->execute(array(':exid'=>$exid,':name'=>$pprname, ':pprcode'=>$pprcode, ':duration'=>$duration,':exdate'=>$examdate, ':ttlset'=>$ttlset, ':ttlques'=>$ttlques, ':ttlmark'=>$ttlmark));
             
          if ($insertvisitor) {
            echo "<div style='color:#990000' class='alert alert-success' role='alert'>Paper Created</div>";
            $last_id = $db->lastInsertId();
            $db->beginTransaction();
            // our SQL statements
            $db->exec("INSERT INTO `examruleandterm`(`paperid`,`imgins`)
            VALUES ($last_id, '$imgins')");
            // commit the transaction
            $db->commit();        
            
            $sqls = "INSERT INTO `papershift`(`paperid`, `shifttime`, `password`) VALUES (:pid,:shifttime,:pass)";
            $rs = $db->prepare($sqls);  
          foreach($extime as $key => $n){            
            $insert = $rs->execute(array(':pid'=>$last_id,':shifttime'=>$extime[$key].":00",':pass'=>$password[$key]));
            if($insert){
              echo'';
            }else{
              echo "<div style='color:#990000' class='alert alert-success' role='alert'>Not Inserted. </div>";
            }
           }             
          } else {
              echo "<div style='color:#990000' class='alert alert-success' role='alert'>Not Inserted. </div>";
          }              
            $db = null;
        }catch(PDOException $e){
          echo $e->getMessage();
        }
       }
}

